skCoA = 
  do
    S.path
      ! A.fill "#EE1C25"
      ! A.stroke "#FFFFFF"
      ! (A.strokeWidth .: 2*s)
      ! A.d coatDirs
  where
    s = 0.09
    k1 = 3
    y1 = 6
    k2 = 2.5
    y2 = 8.3
    cm = 5.77
